    import { ref } from 'vue';
    import { HourRangePicker, type HourRangePickerType } from 'vue-hour-range-picker';
    import 'vue-hour-range-picker/style.css';
    import { useResizeObserver } from '@vueuse/core';
    
    const sectionResponsiveResizer = ref();
